module.exports = {"pageTitle":"About Us","pageBlocks":[{"heroEntryTitle":"About Us Hero","heroTitle":"About Us","heroImage":"//images.ctfassets.net/019o4x34ndl7/3AbOyByaAw0EYYwSGe8o4c/5047a1ae69b5851c4bae8ead17469aad/about-hero.jpg","sectionType":"HeroSection","sysMeta":{"createdAt":"2017-05-29T21:50:49.075Z","updatedAt":"2017-05-29T21:50:49.075Z","contentType":"hero"}},{"entryTitle":"VMC Group Pages Menu","subMenu":{"menuEntryTitle":"VMC Sub Menu","menuItems":[{"menuName":"About Us","menuUrl":"/about-us","menuItemType":"internal_link","sysMeta":{"createdAt":"2017-05-29T22:33:00.180Z","updatedAt":"2017-09-23T04:49:07.559Z","contentType":"menu"}},{"menuName":"The Team","menuUrl":"/the-team","menuItemType":"internal_link","sysMeta":{"createdAt":"2017-05-29T22:33:21.024Z","updatedAt":"2017-09-23T04:49:19.840Z","contentType":"menu"}}],"menuClass":"submenu","sysMeta":{"createdAt":"2017-05-29T22:49:18.809Z","updatedAt":"2017-05-29T22:49:18.809Z","contentType":"Menu"}},"subMenuItems":[{"menuName":"About Us","menuUrl":"/about-us","menuItemType":"internal_link","sysMeta":{"createdAt":"2017-05-29T22:33:00.180Z","updatedAt":"2017-09-23T04:49:07.559Z","contentType":"menu"}}],"sectionType":"SubMenuSection","sysMeta":{"createdAt":"2017-05-29T21:52:25.931Z","updatedAt":"2022-03-28T07:58:21.644Z","contentType":"subMenu"}},{"sectionEntryTitle":"About Us Content Section","sectionMessage":"Ian Lancaster is an entrepreneur who founded Virgin Cars and TwentyCi, the UK’s leading life stage trigger agency. With a solid foundation of industry expertise, Ian previously ran data marketing firm, Dataforce; the company from which TwentyCi was born. Alongside his commitment to TwentyCi, Ian went on to co-found View My Chain, the UK’s only data driven chain management tool.\n\nView My Chain is a platform that has been developed to radically improve the current home moving process.\n\nIt allows agents, buyers and sellers to view automated key buying and selling milestones such as searches being ordered or mortgages applied for.\n\nView My Chain is the only data driven chain management tool which provides the best solution to help agents achieve lower fall throughs, faster completions and less wastage.\n\n<iframe height=\"315\" src=\"https://player.vimeo.com/video/564358648\" frameborder=\"0\" allowfullscreen></iframe>","sectionClass":"standard--static","sectionType":"StandardSection","sysMeta":{"createdAt":"2017-05-29T21:56:02.788Z","updatedAt":"2022-01-07T09:42:30.222Z","contentType":"section"}}],"pageTemplate":"about-us","slug":"about-us","sysMeta":{"createdAt":"2017-05-29T21:56:40.696Z","updatedAt":"2017-05-29T21:57:11.275Z","contentType":"page"}};

