module.exports = {"pageTitle":"Cookies","pageBlocks":[{"sectionEntryTitle":"Cookies Content","sectionTitle":"Cookies","sectionMessage":"## What is a cookie?\nA cookie is a small text file that may be placed on your device when you visit our sites. When you next visit our sites the cookie allows us to distinguish you from other users.\n\n**Cookies we use and why we use them:**\n\nWe may collect information about your computer, including your IP address, operating system and browser type, for system administration and in order to create reports. This is statistical data about our users’ browsing actions and patterns, and does not identify any individual.\n\nThe only cookies in use on our site are for Google Analytics. Google Analytics is a web analytics tool that helps website owners understand how visitors engage with their website. Google Analytics customers can view a variety of reports about how visitors interact with their website so that they can improve it.\n\nLike many services, Google Analytics uses first-party cookies to track visitor interactions as in our case, where they are used to collect information about how visitors use our site. We then use the information to compile reports and to help us improve our site.\n\nCookies contain information that is transferred to your computer’s hard drive. These cookies are used to store information, such as the time that the current visit occurred, whether the visitor has been to the site before and what site referred the visitor to the web page.\n\nGoogle Analytics collects information anonymously. It reports website trends without identifying individual visitors. You can opt out of Google Analytics without affecting how you visit our site – for more information on opting out of being tracked by Google Analytics across all websites you use, visit this [Google page](https://tools.google.com/dlpage/gaoptout).\n\nThird Party Analytics: We have engaged Inspectlet to analyse the activities of visitors to this website, and Inspectlet’s authorized use of cookies and other tracking technologies enable it to have access to Personal Information of visitors to this website. Such access to and use of Personal Information by Inspectlet is governed by Inspectlet’s Privacy Policy https://www.inspectlet.com/legal#privacy. The purpose of this tracking is improve the performance and experience of the website by gaining feedback from users.","sectionClass":"standard--static","sectionType":"StandardSection","sysMeta":{"createdAt":"2017-05-23T14:30:53.040Z","updatedAt":"2018-05-21T11:22:21.807Z","contentType":"section"}}],"pageTemplate":"static","slug":"cookies","sysMeta":{"createdAt":"2017-05-23T14:31:05.773Z","updatedAt":"2017-05-23T14:31:05.773Z","contentType":"page"}};

