module.exports = {"pageTitle":"Documentation Data Structure","pageBlocks":[{"sectionEntryTitle":"Documentation Data Structure Section","sectionMessage":"# Data Structure #\n\nThis section is geared towards allowing you to understand our data structure a little better, so that hopefully the terms will slowly slot into place.\n\n![Screenshot 2018-12-12 at 15.40.09](//images.ctfassets.net/019o4x34ndl7/34Sm5WeNnaC0caiqoQW4Se/69485fe3300a7066aa4f448119defebc/Screenshot_2018-12-12_at_15.40.09.png)","sectionClass":"standard--static","sectionType":"StandardSection","sysMeta":{"createdAt":"2018-12-12T13:05:08.850Z","updatedAt":"2018-12-12T15:42:46.191Z","contentType":"section"}}],"pageTemplate":"static","slug":"documentation-data-structure","sysMeta":{"createdAt":"2018-12-12T13:05:14.020Z","updatedAt":"2018-12-12T13:05:20.166Z","contentType":"page"}};

